function extractFontNames(data) {
  const fontNames = [];
  const regex = /export const (.*?) = localFont/g;

  let match;
  while ((match = regex.exec(data)) !== null) {
    fontNames.push(match[1]);
  }

  return fontNames.join(', ');
}

